import React from "react"
// import ProjectCard from './ProjectCard.js'
import './App.css';
import Page from  './Page.js';
import luk from './images/luk.jpeg'
import merlot from './images/merlot.jpeg'

const films = [
  {image:merlot, title:"Merlot Doesn't Go with Seabass", category:"Narrative Short" , src:"https://vimeo.com/380157225", description: "role: director, writer"},
  {image:luk, title:"Strawberry Generation", category:"Music Video" , src:"https://vimeo.com/380157225" }
]

function Project(props) {
  return (
    <Page className="project-page">
      <h1> Projects</h1>
    </Page>
  )
}


export default Project;
